import axios from "axios";

const API_BASE_URL = "/api"; // ✅ Use relative path since frontend and backend are on the same origin

export const getNearestOffices = async (latitude, longitude) => {
  try {
    const response = await axios.get(`${API_BASE_URL}/offices?lat=${latitude}&lng=${longitude}`);
    return response.data;
  } catch (error) {
    console.error("Error fetching nearest offices:", error);
    return [];
  }
};
